import styled from 'styled-components'

const StyledLogo = styled.div`
	display: flex;
	width: 230px;
	height: 78px;
	background: #FFFFFF;
	border-radius: 0px 0px 9px 9px;
	justify-content: center;
	align-items: center;
	cursor: pointer;
	img {
		display: block;

	}
`

export default StyledLogo
